def bigpow(n, p, m):
    if p == 0:
        return 1
    elif p == 1:
        return n
    elif p % 2 == 0:
        tmp = bigpow(n, p // 2, m)
        return ((tmp * tmp) % m)
    else:
        return ((n * (bigpow(n, p - 1, m) % m)) % m)


